/*
Auto-generated by: https://github.com/pmndrs/gltfjsx
*/

import React, { useRef } from 'react'
import { useGLTF } from '@react-three/drei'
import {useFrame} from "@react-three/fiber";

export function Model(props) {
  const group = useRef()
  const { nodes, materials } = useGLTF('/Ethereum/Ethereum.gltf')

  useFrame(() => {
    group.current.rotation.y += 0.01;
  }, [])

  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="Ethereum" geometry={nodes.Ethereum.geometry} material={materials['Material.006']} position={[0, 1.21, 0]} scale={[0.51, 0.01, 0.51]} material-color="#2f55d4" />
      </group>
    </group>
  )
}

useGLTF.preload('/Ethereum/Ethereum.gltf')
